function Vote({polls, setPolls, pollSelected}) {
  return (
    <form>
        {polls.map((poll) => ( 
            
            poll.id === pollSelected ? (
                <h1>{poll.question}</h1>

            ):(
                none
            )

        ))}
    </form>
  )
}

